import styled from "styled-components";
import MainSecFriend from "./MainSecFriend";
import MainSecFriendImg from "./MainSecFriendImg";
import { GlobalButton } from "../../stylesGlobal";
import { GlobalSection } from "../../stylesGlobal";

const GlobalSection4 = styled(GlobalSection)`
    position: relative;
`;

GlobalButton = styled.button`
  box-shadow: 3px 5px 7px rgba(0, 0, 0, 0.25);
  cursor: pointer;
  background-color: #000;
  color: #f5f5f5;
  font-size: 1.5rem;
  font-weight: normal;
  border-radius: 5px;
  margin: 1.5rem 0rem;
  border: none;
  border-radius: 5px;
`;

const NewButton = styled(GlobalButton)`
    position: absolute;
    top: 97%;
    left: 50%;
    transform: translate(-50%, -50%);
    cursor: pointer;
`;

function Section04() {
    return (
        <GlobalSection4>
            <MainSecFriend />
            <MainSecFriendImg />
            <a href="friend">
                <NewButton>Descubre el plan amigo</NewButton>
            </a>
        </GlobalSection4>
    )
};

export default Section04;
